INSERT INTO `site_faq` (`id`, `question`, `answer`, `status`) VALUES
(1, 'What is Lill?', 'Lill has more to it than just shortening links. Lill offers custom link generation that relates to your product or information that you are sharing through your link. It is a tool to create meaningful URLs that generates increased shares and clicks thus resulting in brand build.', 1),
(2, 'What is custom links in Lill?', 'Lill provides a tool for our subscribers to create short descriptive links that relates to their brand. Customers can use their brand domain name, related-keyword slug and also emojis in the shortened link. This increases credibility and the click rate. For eg: fast.burger/OrderNow  OR  cma.classes/JoinNow  OR  jade.blue/FreeOffers', 1),
(3, 'Why opt for Lill?', 'Earn attractive shortened URLs through Lill that increases the click rates and helps you in increased lead generation. Also, Lill provides a complete link data chart for you to analyze the click performance on various platforms that it was shared. Custom links through Lill increases the trust worthiness of your brand and helps in attaining higher sales and profits.', 1),
(4, 'How safe is Lill?', 'Lill provides SSL certification for all branded shortened links. Each of the Lill shortened URLs shared will have an https:// encryption so that it is safe from spammers.', 1),
(5, 'What is the custom domain pricing in Lill?', 'Lill uses third-party domain for custom branding. Hence, the prices are dependent on third-party services.', 1),
(6, 'Which browsers does Lill support?', 'Lill runs smoothly on all popular browsers like Google Chrome, Firefox, Edge and Safari.', 1),
(7, 'Does Lill offer customer support?', 'Yes, Lill offers customer support to paid subscribers to help them in picking their custom domains for shortened URLs.', 1),
(8, 'How do I sign for Lill subscription?', 'You can either opt for a free account or a paid subscription when signing for Lill. If you opt for a subscription plan, the custom pricing details are mentioned on either a monthly or yearly basis. Once you have selected your plan, you can Get Started by signing in through an account and entering the email address. Your email address will be verified to get started.', 1),
(9, 'What is Lill dashboard?', 'Your Lill dashboard has everything that the Lill shortened URL has achieved. It gives an overall view of the total clicks, links created, shares and demographic details of the shares like the location, devices used, etc.', 1),
(10, 'What about Lill integrations?', 'Lill offers integration tools to many apps, particularly the social media apps. It also offers mobile deep links to give the mobile users the option to download your app or view the link on your mobile web app.', 1);
